    false,nt"url": null,nt"notes": "Watershed Sciences, Inc. (WSI) collected
    Light Detection and Ranging (LiDAR) data of the Upper Naches River Valley and Nile
    Slide area of interest on September 30th, 2011-October 1st, 2011 and April 5th,
    2012 for the Puget Sound LiDAR Consortium. The valley bottom was reflown in 2012
    during "leaf-off" conditions, to ensure a more detailed bare earth model, and
    matched with the upslope data from 2011 to provide a seamless dataset. The requested
    area was expanded to include a 100m buffer to ensure complete coverage and adequate
    point densities around survey area boundaries. The total acreage of this delivery
    is 23,771 acres of LiDAR data. The LiDAR survey utilized a Leica ALS60 sensor in
    a Cessna Caravan 208B. Please see "Project Report" below for specific information
    regarding the airborne survey and ground survey. This Lidar survey acheived a nominal
    point spacing of 11.60 points per square meter.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
